problem:
Below is the graph of $y = a \sin (bx + c)$ for some positive constants $a,$ $b,$ and $c.$  Find the smallest possible value of $c.$

[asy]import TrigMacros;

size(300);

real f(real x)
{
	return 2*sin(4*x + pi/2);
}

draw(graph(f,-pi,pi,n=700,join=operator ..),red);
trig_axes(-pi,pi,-3,3,pi/2,1);
layer();
rm_trig_labels(-2,2, 2);

label("$1$", (0,1), E);
label("$2$", (0,2), E);
label("$-1$", (0,-1), E);
label("$-2$", (0,-2), E);
[/asy]

In triangle $ABC,$ $AB = 9,$ $BC = 10,$ and $AC = 11.$  If $D$ and $E$ are chosen on $\overline{AB}$ and $\overline{AC}$ so that $AD = 4$ and $AE = 7,$ then find the area of triangle $ADE.$

[asy]
unitsize (1 cm);

pair A, B, C, D, E;

A = (2,3);
B = (0,0);
C = (6,0);
D = interp(A,B,0.4);
E = interp(A,C,3/5);

draw(A--B--C--cycle);
draw(D--E);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$E$", E, NE);
[/asy]

solution:
We can expand the determinant as follows:
\begin{align*}
\begin{vmatrix} 2 & 0 & -1 \\ 7 & 4 & -3 \\ 2 & 2 & 5 \end{vmatrix} &= 2 \begin{vmatrix} 4 & -3 \\ 2 & 5 \end{vmatrix} + (-1) \begin{vmatrix} 7 & 4 \\ 2 & 2 \end{vmatrix} \\
&= 2((4)(5) - (-3)(2)) - ((7)(2) - (4)(2)) \\
&= \boxed{46}.
\end{align*}

problem:
Below is the graph of $y = a \tan bx$ for some positive constants $a$ and $b.$  Find $ab.$

[asy]import TrigMacros;

size(250);

real g(real x)
{
	return 2*tan(3/2*x);
}

draw(graph(g,-pi + 0.01,-pi/3 - 0.01),red);
draw(graph(g,-pi/3 + 0.01,pi/3 - 0.01),red);
draw(graph(g,pi/3 + 0.01,pi - 0.01),red);
limits((-pi,-4),(pi,4),Crop);
draw((-pi/3,-4)--(-pi/3,4),dashed);
draw((pi/3,-4)--(pi/3,4),dashed);
trig_axes(-pi,pi,-4,4,pi/6,1);
layer();
rm_trig_labels(-5, 5, 6);

label("$1$", (0,1), E);
label("$2$", (0,2), E);
label("$3$", (0,3), E);
label("$-1$", (0,-1), E);
label("$-2$", (0,-2), E);
label("$-3$", (0,-3), E);
[/asy]

solution:
From $r = \frac{1}{\sin \theta - \cos \theta},$
\[r \sin \theta - r \cos \theta = 1.\]Then $y - x = 1,$ which is the equation of a line.  The answer is $\boxed{\text{(A)}}.$

[asy]
unitsize(2 cm);

draw((-1.3,-0.3)--(0.3,1.3),red);
draw((-1.3,0)--(0.3,0));
draw((0,-0.3)--(0,1.3));
label("$r = \frac{1}{\sin \theta - \cos \theta}$", (-1,1), red);
[/asy]

problem:
A circle centered at $O$ has radius 1 and contains the point $A$. Segment $AB$ is tangent to the circle at $A$ and $\angle
AOB=\theta$. If point $C$ lies on $\overline{OA}$ and $\overline{BC}$ bisects $\angle ABO$, then express $OC$ in terms of $s$ and $c,$ where $s = \sin \theta$ and $c = \cos \theta.$

[asy]
pair A,B,C,O;
O=(0,0);
A=(1,0);
C=(0.6,0);
B=(1,2);
label("$\theta$",(0.1,0),NE);
label("$O$",O,S);
label("$C$",C,S);
label("$A$",A,E);
label("$B$",B,E);
draw(A--O--B--cycle,linewidth(0.7));
draw(C--B,linewidth(0.7));
draw(Circle(O,1),linewidth(0.7));
[/asy]

Let $P$ be the point on line segment $\overline{AB}$ such that $AP:PB = 2:7.$  Then
\[\overrightarrow{P} = t \overrightarrow{A} + u \overrightarrow{B}\]for some constants $t$ and $u.$  Enter the ordered pair $(t,u).$

[asy]
unitsize(1 cm);

pair A, B, P;

A = (0,0);
B = (5,1);
P = interp(A,B,2/9);

draw(A--B);

dot("$A$", A, S);
dot("$B$", B, S);
dot("$P$", P, S);
[/asy]

solution:
We can expand the determinant as follows:
\begin{align*}
\begin{vmatrix} 1 & x & y \\ 1 & x + y & y \\ 1 & x & x + y \end{vmatrix} &= \begin{vmatrix} x + y & y \\ x & x + y \end{vmatrix} - x \begin{vmatrix} 1 & y \\ 1 & x + y \end{vmatrix} + y \begin{vmatrix} 1 & x + y \\ 1 & x \end{vmatrix} \\
&= ((x +  y)^2 - xy) - x((x + y) - y) + y(x - (x + y)) \\
&= \boxed{xy}.
\end{align*}

By product-to-sum,
\begin{align*}
4 \sin x \sin (60^\circ - x) \sin (60^\circ + x) &= 4 \sin x \cdot \frac{1}{2} (\cos 2x - \cos 120^\circ) \\
&= 2 \sin x \left( \cos 2x + \frac{1}{2} \right) \\
&= 2 \sin x \cos 2x + \sin x.
\end{align*}Again by product-to-sum,
\begin{align*}
2 \sin x \cos 2x + \sin x &= \sin 3x + \sin (-x) + \sin x \\
&= \boxed{\sin 3x}.
\end{align*}

